class Solution:
    # @param S, a string
    # @param L, a list of string
    # @return a list of integer
    def findSubstring(self, S, L):

        r = []
        p = 0
        for x in L:
            #p = self.strStr(S, x, p + len(x))
            r.append( 0 )

        return r


    def strStr(self, haystack, needle, start):

        if needle == haystack or needle== '' :
            return 0
        elif needle== None or haystack == None or haystack=='':
            return -1

        h = len(haystack)
        n = len(needle)

        if n >= h :
            return -1

        for i in range(start, h-n+1):

            find = True

            for j in range(n):
                if haystack[i + j]!=needle[j]:
                    find = False
                    break

            if find:
                return i
        return -1


